var isNumeric = require('fast-isnumeric');

module.exports = {
  count: function count(n, i, size) {
    size[n]++;
    return 1;
  },
  sum: function sum(n, i, size, counterData) {
    var v = counterData[i];

    if (isNumeric(v)) {
      v = Number(v);
      size[n] += v;
      return v;
    }

    return 0;
  },
